import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  logo: {
    width: "100px",
  },
  rightGridColor: {
    color: theme.palette.grey[500],
  },
  headDataItems: {
    padding: theme.spacing(0, 2),
    cursor: "pointer",
  },
}));
